import React from 'react';
import styled from 'styled-components';

const AppContainer = styled.div`
  display: flex;
  flex: 1 auto;
  height: 100vh;
  background-color: grey;
`;

const Grid = styled.div`
  display: flex;
  flex: 1 auto;
  border: 1px solid red;
`;

function App() {
  return (
    <AppContainer>
      <Grid />
    </AppContainer>
  );
}

export default App;
